  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The CMS Wallet Card is a quick reference
  statistical summary on annual CMS program and financial data. The CMS Wallet Card
  is available for each year from 2004 through 2012.  The 2012 version is the last
  version of the Wallet Card.  Similar information is available in the CMS Fast Facts,
  a new quick reference and mobile enabled CMS information product with statistical
  summaries on CMS program and financial data.  The CMS Fast Facts is updated as new
  data become available.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
